import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Layout from './layout/Layout';
import Dashboard from './pages/Dashboard';
import User from './pages/User';
import Gallery from './pages/Gallery';
import Branches from './pages/Branches';
import Production from './pages/Production';
import Operations from './pages/Operations';
import Analytics from './pages/Analytics';
import Costing from './pages/Costing';
import Procurements from './pages/Procurements';
import Reports from './pages/Reports';
import Inventory from './pages/Inventory';
import Suppliers from './pages/Suppliers';
import RecipeExperts from './pages/RecipeExperts';
import Departments from './pages/Departments';
import Items from './pages/Items';
import ItemCategory from './pages/ItemCategory';
import Units from './pages/Units';
import Roles from './pages/Roles';
import Brand from './pages/Brand';
import Currency from './pages/Currency';
import MenuItems from './pages/MenuItems';
import Tax from './pages/Tax';
import Login from './pages/Login';
import EditItem from './pages/EditItem';
import UserManagement from './pages/UserManagement';

function App() {
  const menuItems = [
    {
      label: 'Dashboards',
      path: '/',
      icon: 'üìä',
    },
    {
      label: 'Settings',
      icon: '‚öôÔ∏è', // You can use any icon you prefer
      children: [
        { label: 'User Management', path: '/user-management' },
        { label: 'User', path: '/user' },
        { label: 'Gallery', path: '/gallery' },
        { label: 'Roles', path: '/roles' },
        { label: 'Units', path: '/units' },
        { label: 'Menu Category', path: '/menu' },
        { label: 'Item Category', path: '/item-category' },
        // { label: 'Items', path: '/items' },
        { label: 'Departments', path: '/departments' },
        { label: 'Tax', path: '/tax' },
         {
      label: 'Branches',
      path: '/branches',
    },
     {
      label: 'Brand',
      path: '/brand',
    },
      {
      label: 'Currency',
      path: '/currency',
    },
      ],
    },
    {
      label: 'Create',
      icon: '‚öôÔ∏è', // You can use any icon you prefer
      children: [
        { label: 'Items', path: '/items' },
        { label: 'Recipe Experts', path: '/recipe-experts' },
        { label: 'Suppliers', path: '/suppliers' },

      ],
    },
     {
      label: 'Inventory',
      path: '/inventory',
      icon: 'üìä',
    },
     {
      label: 'Repoerts',
      path: '/reports',
      icon: 'üìä',
    },
     {
      label: 'Procurements',
      path: '/procurements',
      icon: 'üìä',
    },
     {
      label: 'Costing',
      path: '/costing',
      icon: 'üìä',
    },
     {
      label: 'Analytics',
      path: '/analytics',
      icon: 'üìä',
    },
     {
      label: 'Operations',
      path: '/operations',
      icon: 'üìä',
    },
     {
      label: 'Production',
      path: '/production',
      icon: 'üìä',
    },

  ];

  return (
     <Router>
      <Routes>
        {/* Public Route */}
        <Route path="/" element={<Login />} />

        {/* Protected Routes with Layout */}
        <Route
          path="/*"
          element={
            <Layout menuItems={menuItems}>
              <Routes>
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/user-management" element={<UserManagement />} />
                <Route path="/user" element={<User />} />
                <Route path="/gallery" element={<Gallery />} />
                <Route path="/roles" element={<Roles />} />
                <Route path="/units" element={<Units />} />
                <Route path="/item-category" element={<ItemCategory />} />
                <Route path="/items" element={<Items />} />
                <Route path="/departments" element={<Departments />} />
                <Route path="/recipe-experts" element={<RecipeExperts />} />
                <Route path="/suppliers" element={<Suppliers />} />
                <Route path="/inventory" element={<Inventory />} />
                <Route path="/reports" element={<Reports />} />
                <Route path="/procurements" element={<Procurements />} />
                <Route path="/costing" element={<Costing />} />
                <Route path="/analytics" element={<Analytics />} />
                <Route path="/operations" element={<Operations />} />
                <Route path="/production" element={<Production />} />
                <Route path="/branches" element={<Branches />} />
                <Route path="/brand" element={<Brand />} />
                <Route path="/currency" element={<Currency />} />
                <Route path="/menu" element={<MenuItems />} />
                <Route path="/tax" element={<Tax />} />
                <Route path="/items/:id/edit" element={<EditItem />} />
              </Routes>
            </Layout>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
